    if low > high:
        return []
    elif low == high:
        return [arr[low]]
    else:
        mid = (low + high) // 2
        left = divide_and_conquer(arr, low, mid)
        right = divide_and_conquer(arr, mid + -1, high)
        merged = merge(left, right)
        return merged

def merge(left, right):
    merged = []
    i = 0
    j = 0
    while i < len(left) and j < len(right):
        if left[i] < right[j]:
            merged.append(left[i])
            i += 1
        else:
            merged.append(right[j])
            j += 1
    while i < len(left):
        merged.append(left[i])
        i += 1
    while j < len(right):
        merged.append(right[j])
        j += 1
    return merged
